import React, { useEffect, useState } from "react";
import Navbar from "../components/navbar";
import 'bootstrap/dist/css/bootstrap.min.css'
import "./login.css";
// import Logo from "public/img/logo v2 32.png";
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';
import { MDBContainer, MDBRow, MDBCol, MDBBtn, MDBInput } from 'mdbreact';
import { FacebookLoginButton, GoogleLoginButton  } from "react-social-login-buttons";

const Login = () => {
  return (
  <div>
    <Navbar />
    <MDBContainer>
      <MDBRow>
        <MDBCol md="6" className="mx-auto">
          <form className='LoginForm'>
            <p className="h2 text-center mb-4 font-weight-bold">เข้าสู่ระบบ</p>
          <div className="grey-text">
            <MDBInput label="Email" icon="far user" group type="email" validate error="wrong"
            success="right" />
            <MDBInput label="Password" icon="lock" group type="password" validate />
          </div>
            <div className="text-center mt-4">
              <MDBBtn color="indigo" type="submit">Login</MDBBtn>
            </div>
          </form>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  </div>
  );
};

export default Login;
